 Here is a JavaScript function that uses regex to extract a three character code from a filename in format "57-1Jn.usfm":

```javascript
function extractCode(filename) {
    var re = /(\d*[A-Za-z]{3})\.(usfm)/;
    var result = filename.match(re);
    return (result && result.length > 0) ? result[1] : '';
}
```

You can use this function like so:

```javascript
console.log(extractCode("57-1Jn.usfm")); // Outputs: "1Jn"
console.log(extractCode("43-2Ab.usfm")); // Outputs: "2Ab"
console.log(extractCode("65-3Cd.usfm")); // Outputs: "3Cd"
```
